using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Text.Encodings.Web;
using System.Threading.Tasks;
using Microsoft.AspNetCore.Mvc;
using Newtonsoft.Json;
using PackFresh.CustomerSite.Models;

// For more information on enabling MVC for empty projects, visit https://go.microsoft.com/fwlink/?LinkID=397860

namespace PackFresh.CustomerSite.Controllers
{
    public class ProductController : Controller
    {
       
        private Product product;

        public IActionResult Product(string id)
        {

            product = getById(id);

            List<ProductRange> productRanges = getRangesByName(product.RangeName);

            product.Range = productRanges;

            return View(product);
        }


        private Product getById(string id)
        {

            Product product1 = new Product();
            product1.ID = "1";
            product1.RangeName = "Stand Up Pouches";
            product1.Description = "Stand up pouches are a versatile, cost effective way to package foods, liquids and non-food items. It can be manufactured in several sizes and materials with customer friendly features, such as zippers, tear notches, hang holes, even vents. Given its flat front and back design, its ideal for custom printing.";
            product1.Uses = "Dried and fresh foods, cured meats, herbs, spices, Powders, coffee, tea. Can also be used to store non food items.";


            Product product2 = new Product();
            product2.ID = "2";
            product2.RangeName = "Polypropylene";
            product2.Description = " This is a product description for Polypropylene";
            product2.Uses = "RED";


            Product product3 = new Product();
            product3.ID = "3";
            product3.RangeName = "Nature Flex Cellophane";
            product3.Description = " This is a product description for Nature Flex Cellophane";
            product3.Uses = "RED";

            List<Product> products = new List<Product> { product1, product2, product3 };

            Product returnValue = products.AsQueryable<Product>().First(e => e.ID.Equals(id));

            return returnValue;
        }




        private List<ProductRange> getRangesByName(string rangeName)
        {
            byte[] data = Convert.FromBase64String("");
            string decodedString = Encoding.UTF8.GetString(data);

            List<ProductRange> productRangeList = JsonConvert.DeserializeObject<List<ProductRange>>(decodedString);

            List<ProductRange> filterredProductRangeList = (productRangeList.Where(e => e.Range == rangeName)).ToList();

            return filterredProductRangeList;

        }


    }
}
